/**
 * Serialize an element.
 *
 * @param {Element} node
 *   xast element node.
 * @param {State} state
 *   Info passed around about the current state.
 * @returns {string}
 *   Serialized XML.
 */
export function element(node: Element, state: State): string;
export type Element = import('xast').Element;
export type State = import('./index.js').State;
